import styled from "styled-components";

const FooterContainer = styled.div`
  display: flex;
  justify-content: flex-end;
  width: 100%;
  height: 5rem;
  position: absolute;
  bottom: 0;
`;

const FooterContact = styled.div`
  display: flex;
  align-items: center;
  justify-content: center;
  padding-right: 3rem;
`;

function Footer() {
  return (
    <FooterContainer>
      <FooterContact>
        <span>Social media</span>
        <span>I</span>
        <span>Y</span>
      </FooterContact>
    </FooterContainer>
  );
}

export default Footer;
